@csxdrail @evenkeelkelly @PoppaWoody16 @MoonboundA @EricMMatheny @whalesonly1 "Passes"?

I talked w/ my Dr about Covid when it came in, and then again when the vaccine came. I made a rational adult decision for myself &amp; family / friends - and then I did what I thought was right for my community.

It wasn't difficult. I didn't cry.

@WonPeople Around 4-5k spread over two cars.

Until 3 years ago I was always in excess of 20k but for the first time ever I live within a few miles of work. 

Covid also changed my shopping habits with so much bought on line now instead of driving around.
